import React from "react";
import Recepie from "../Recepie/Recepie";

export default function RecepieList({ recepies, ingredients }) {
  console.log(ingredients + "ingred");
  return (
    <div>
      {recepies.map((recepie) => {
        return (
          <Recepie key={recepie.id} {...recepie} ingredients={ingredients} />
        );
      })}
    </div>
  );
}
